CMS.registerEditorComponent({id:"tabs-pmba",label:"Insertar Tabs del Torneo",fields:[{name:"tabTotal",label:"Numero de Tabs",widget:"number"},{name:"tabName",label:"Nombre del Tab",widget:"select",options:["informacion","premios","fotos"]},{name:"contenidoTab",label:"Contenido Tab",widget:"markdown"}],fromBlock:function(match){return{tabtotal:match[1],tabname:match[2],contenidotab:match[3]}},toBlock:function(data){return`\n      <tabs tabTotal="${data.tabtotal}">\n        <tab tabName="${data.tabname}">\n          ${data.contenidotab}\n        </tab>\n      </tabs>\n      `},toPreview:function(data){return`\n      <tabs tabTotal="${data.tabtotal}">\n        <tab tabName="${data.tabname}">\n          ${data.contenidotab}\n        </tab>\n      </tabs>\n      `}});